<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <title></title>
    <meta name="viewport" content="width=device-width, initial-scale=1.0, minimum-scale=1.0,maximum-scale=1.0, user-scalable=0" />
    <link rel="stylesheet" href="css/style.css">
</head>
<body>
<div class="header">
    <i class="iconfont icon-meun i-left i-menu"></i>
    <i class="iconfont icon-plus i-plus"></i>
</div>
<div class="fm-container"><div class="health-container">
    <div class="health-row health-index">
        <div class="health-box" style="justify-content: center">
            <h1>请调到chrome手机模式</h1>
        </div>
    </div>
    <div class="health-row health-circle">
        <div class="health-box">
        </div>
    </div>
    <div class="health-row health-vaccine">
        <div class="health-box">
            <div class="health-icon-box">
                <i class="iconfont icon-vaccine"></i>
            </div>
            <div class="percents-bar">
                <div class="bar-bg">
                    <div class="percent-line"></div>
                    <div class="percent-box">
                        <div class="percent-circle"></div>
                        <div class="percent-circle-in"></div>
                        <div class="percent-circle-in"></div>
                        <div class="percent-circle-in"></div>
                        <div class="percent-circle"></div>
                    </div>
                </div>
                <div class="bar-on" style="width: 20%">
                    <div class="percent-line"></div>
                    <div class="percent-box">
                        <div class="percent-circle"></div>
                        <div class="percent-circle-in"></div>
                        <div class="percent-circle-in"></div>
                        <div class="percent-circle-in"></div>
                        <div class="percent-circle"></div>
                    </div>
                </div>
            </div>
            <div class="percent">20%</div>
        </div>
    </div>
    <div class="health-row health-parasite">
        <div class="health-box">
            <div class="health-icon-box">
                <i class="iconfont icon-parasite"></i>
            </div>
            <div class="percents-bar">
                <div class="bar-bg">
                    <div class="percent-line"></div>
                    <div class="percent-box">
                        <div class="percent-circle"></div>
                        <div class="percent-circle-in"></div>
                        <div class="percent-circle-in"></div>
                        <div class="percent-circle-in"></div>
                        <div class="percent-circle"></div>
                    </div>
                </div>
                <div class="bar-on" style="width: 30%">
                    <div class="percent-line"></div>
                    <div class="percent-box">
                        <div class="percent-circle"></div>
                        <div class="percent-circle-in"></div>
                        <div class="percent-circle-in"></div>
                        <div class="percent-circle-in"></div>
                        <div class="percent-circle"></div>
                    </div>
                </div>
            </div>
            <div class="percent">30%</div>
        </div>
    </div>
    <div class="health-row health-beauty">
        <div class="health-box">
            <div class="health-icon-box">
                <i class="iconfont icon-beauty"></i>
            </div>
            <div class="percents-bar">
                <div class="bar-bg">
                    <div class="percent-line"></div>
                    <div class="percent-box">
                        <div class="percent-circle"></div>
                        <div class="percent-circle-in"></div>
                        <div class="percent-circle-in"></div>
                        <div class="percent-circle-in"></div>
                        <div class="percent-circle"></div>
                    </div>
                </div>
                <div class="bar-on" style="width: 50%">
                    <div class="percent-line"></div>
                    <div class="percent-box">
                        <div class="percent-circle"></div>
                        <div class="percent-circle-in"></div>
                        <div class="percent-circle-in"></div>
                        <div class="percent-circle-in"></div>
                        <div class="percent-circle"></div>
                    </div>
                </div>
            </div>
            <div class="percent">50%</div>
        </div>
    </div>
</div></div>
<div class="popup-layer"></div>
</body>
</html>
